                                  <MDBModalTitle>Team us</MDBModalTitle>
                                  <MDBBtn
                                    className='btn-close'
                                    color='none'
                                    onClick={() => setModal7(!modal7)}
                                  ></MDBBtn>
                                </MDBModalHeader>
                                <MDBModalBody  className="modal-body body-modal1 ">
                                
                                <div id="change_iconarrow" className="body-modal modal7">
                                    <div id="change_iconarrow" className="card-body text-center text-title-box2">
                                      <MDBTooltip tag='svg'  title="click down to view" >
                                        <svg className="arrows"  >
